import React, { Component } from "react";
import '../App.css';
import { FaSearch} from 'react-icons/fa';
import { MdLocationOn } from 'react-icons/md';
import SecondComponent from './SecondComponent';

class Home extends Component {
  state = {
      weekArr: [
          {id: 1, day: 'Sun'},
          {id: 2, day: 'Mon'},
          {id: 3, day: 'Tue'},
          {id: 4, day: 'Wed'},
          {id: 5, day: 'Thu'},
          {id: 6, day: 'Fri'},
          {id: 7, day: 'Sat'}
      ],
  };

  render() {
    return (
      <div style={styles.mainStyle}>
        <div style={styles.boxStyle} > 
        <div style={{
            flexDirection: 'row',  
            display: 'flex', 
            //border: "1px solid black"
            }}>
        <MdLocationOn size='2em' />
            <h3 style={{paddingLeft: '16%', }}>Location</h3>
        </div>
           <FaSearch size='2em'/>
        </div>
        <div style={{
            display: 'flex', 
            marginTop: '4%', 
            border: "1px solid black",
            flexDirection: 'row', 
            //marginRight: '30%',
            flexGrow: 1,
            width: '100%'
            }}>
            {
                this.state.weekArr.map((item, index) => {
                    return (
                        <SecondComponent key={item.id} data={item}/>
                    );
                })
            }
        </div>
      </div>
    );
  }
}

const styles = {
  mainStyle: {
    display: "flex",
    alignItems: 'center',
    margin: "1.6%",
    marginLeft: '20%',
    marginRight: '20%',
    flexDirection: 'column'
  },
  boxStyle: {
    display: 'flex',
    flexDirection: 'row',
    height: 80,
    borderRadius: 8,
    padding: '1.6%',
    justifyContent: 'space-between',
    boxShadow: "1px 4px 6px 1px #9E9E9E",
    width: '100%',
  }
};

export default Home;
